def extract_events(inputs: Dict[str, Any]) -> str:
    """
    This is function is used to identify and extract structured events and attributes related to the specified entities from the input text.
    The entities, along with their types and names, have been identified in a previous step and are provided for reference.

     The function takes a dictionary of `inputs` as an argument, which contains the following keys:
    - 'input_text': the input eligibility criteria in text format
    - 'entities': a list of entities, each containing the type and name of an entity identified in the input text
        e.g., ["Condition: Type 2 diabetes mellitus", "Drug/Substance: Metformin", "Measurement: Serum creatinine", "Procedure/Device: Chemotherapy", "Observation: Smoking", "Observation: 30 to 75 years old", ...]

    The function should return a list of dictionaries, each containing the extracted events and attributes for the specified entities.
    - Event entity types include: `Condition`, `Observation`, `Procedure/Device`, `Drug/Substance`.
    - Attribute entities include: `Measurement`, `Temporal Constraints`, `Qualifiers/Modifiers`.

    The formats of the target extracted events are as follows:


    Observation:
    {{
        "id": int, \\ the unique identifier of the event, starting from 1 to N
        "type":"Observation",
        "name": str, \\ the name of the observation
        "occurrence": {{
            "operator": str, \\ the operator of the occurrence, in ["at least", "at most", "exactly"]
            "number": int, \\ the number of occurrence
        }},
        "temporal": {{
            "start": {{
                "number": int, \\ the number of days/months/years/etc before the reference event
                "unit": str, \\ the unit of the temporal, in ["days", "weeks", "months", "years"]
            }},
            "end":{{
                "number": int, \\ the number of days/months/years/etc after the reference event
                "unit": str, \\ the unit of the temporal, in ["days", "weeks", "months", "years"]
            }},
            "reference_event": int, \\ the reference event id for the start and end window
        }},
        "value":{{
            "range": {{
                "lower_bound": float, \\ the lower bound of the measurement value
                "upper_bound": float, \\ the upper bound of the measurement value
                "unit": str, \\ the unit of the measurement value
            }},
            "qualitative": str, \\  the qualitative value of the measurement, e.g., "positive", "negative", "normal", "abnormal", etc.
        }},
    }}

    Condition:
    {{
        "id": int, \\ the unique identifier of the event, starting from 1 to N
        "type":"Condition", \\ the type of the entity
        "name": str, \\ the name of the condition
        "occurrence": {{
            "operator": str, \\ the operator of the occurrence, in ["at least", "at most", "exactly"]
            "number": int, \\ the number of occurrences 
            }},
        "temporal": {{
            "start": {{
                "number": int, \\ the number of days/months/years/etc before the reference event
                "unit": str, \\ the unit of the temporal, in ["days", "weeks", "months", "years"]
            }},
            "end":{{
                "number": int, \\ the number of days/months/years/etc after the reference event
                "unit": str, \\ the unit of the temporal, in ["days", "weeks", "months", "years"]
            }},
            "reference_event": int, \\ the reference event id for the start and end window
        }}
    }}

    Drug/Substance:
    {{
        "id": int, \\ the unique identifier of the event, starting from 1 to N
        "type":"Drug/Substance",
        "name": str, \\ the name of the drug
        "occurrence": {{
            "operator": str, \\ the operator of the occurrence, in ["at least", "at most", "exactly"]
            "number": int, \\ the number of occurrence
        }},
        "temporal": {{
            "start": {{
                "number": int, \\ the number of days/months/years/etc before the reference event
                "unit": str, \\ the unit of the temporal, in ["days", "weeks", "months", "years"]
            }},
            "end":{{
                "number": int, \\ the number of days/months/years/etc after the reference event
                "unit": str, \\ the unit of the temporal, in ["days", "weeks", "months", "years"]
            }},
            "reference_event": int, \\ the reference event id for the start and end window
        }}
    }}


    Procedure/Device:
    {{
        "id": int, \\ the unique identifier of the event, starting from 1 to N
        "type":"Procedure/Device",
        "name": str, \\ the name of the procedure
        "occurrence": {{
            "operator": str, \\ the operator of the occurrence, in ["at least", "at most", "exactly"]
            "number": int, \\ the number of occurrence
        }},
        "temporal": {{
            "start": {{
                "number": int, \\ the number of days/months/years/etc before the reference event
                "unit": str, \\ the unit of the temporal, in ["days", "weeks", "months", "years"]
            }},
            "end":{{
                "number": int, \\ the number of days/months/years/etc after the reference event
                "unit": str, \\ the unit of the temporal, in ["days", "weeks", "months", "years"]
            }},
            "reference_event": int, \\ the reference event id for the start and end window
        }}
    }}

    IMPORTANT: 
    - for all the events, the fields 'id', 'type', 'name' are mandatory, the other fields are optional and should be included only if they are present in the input text.
    - for all the events, the field 'type' must be one of the following: 'Condition', 'Observation', 'Procedure/Device', 'Drug/Substance'.

    The function should return a syntactically correct JSON format string that contains a list of the extracted events, each event should be one of the above formats.
    The output is wrapped within  ```json and ``` tags, for example:
    ```json
    [
        {{
            "id": 1, \\ the unique identifier of the event, starting from 1 to N
            "type":"Observation", \\ the type of the entity
            "name": "age", \\ the name of the observation
            "value":{{
                "range": {{
                    "lower_bound": float, \\ the lower bound of the age value
                    "upper_bound": float, \\ the upper bound of the age value
                    "unit": str, \\ the unit of the age value
                }},
            }},
        }},
        ... \\ other events
    ]
    ```

    Returns:
    - str: a JSON format string that contains a list of the extracted events, wrapped by ```json and ``` tags
    """
inputs = {
    "input_text": "The study includes patients with conditions such as oligo-amenorrhea, PCOS, and premature ovarian insufficiency.",
    "entities": [
        {"entity": "conditions", "category": "Condition"},
        {"entity": "oligo-amenorrhea", "category": "Condition"},
        {"entity": "PCOS", "category": "Condition"},
        {"entity": "premature ovarian insufficiency", "category": "Condition"}
    ]
}

def extract_events(inputs: Dict[str, Any]) -> str:
    entities = inputs["entities"]
    events = []
    id_counter = 1

    for entity in entities:
        if entity["category"] == "Condition":
            event = {
                "id": id_counter,
                "type": "Condition",
                "name": entity["entity"]
            }
            events.append(event)
            id_counter += 1

    return f"""```json
{json.dumps(events, indent=4)}
```"""

print(extract_events(inputs))
```

